webpackJsonp([1104],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-the-javascript-continue-statement.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h2>Introduction</h2>\n<p>The <strong>continue</strong> statement terminates execution of the statements in the current iteration of the current or labeled loop, and continues execution of the loop with the next iteration.</p>\n<pre><code>continue;\n</code></pre>\n<p>If the <strong>continue</strong> statement is used in a labeled statement, the syntax is as follows:</p>\n<pre><code>continue labelName;\n</code></pre>\n<p>In contrast to the <strong>break</strong> statement, <strong>continue</strong> does not terminate the execution of the loop entirely; instead:  </p>\n<ul>\n<li>In a <code>while</code> loop, it jumps back to the condition.  </li>\n<li>In a <code>for</code> loop, it jumps to the update expression.</li>\n</ul>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Statements/continue">MDN link</a> | <a href="https://msdn.microsoft.com/en-us/library/8de3fkc8.aspx">MSDN link</a></p>\n<h2>Examples</h2>\n<p>The following example shows a <code>while</code> loop that has a <strong>continue</strong> statement that executes when the value of <strong>i</strong> is 3. Thus, <strong>n</strong> takes on the values 1, 3, 7, and 12.</p>\n<pre><code>var i = 0;\nvar n = 0;\n\nwhile (i &#x3C; 5) {\n  i++;\n\n  if (i === 3) {\n    continue;\n  }\n\n  n += i;\n  console.log (n);\n}\n</code></pre>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/C7hx/0">Run Code</a></p>\n<p>In the following example, a loop iterates from 1 through 9. The statements between <strong>continue</strong> and the end of the <code>for</code> body are skipped because of the use of the <strong>continue</strong> statement together with the expression <code>(i &#x3C; 5)</code>.</p>\n<pre><code>for (var i = 1; i &#x3C; 10; i++) {\n    if (i &#x3C; 5) {\n        continue;\n    }\n    console.log (i);\n}\n</code></pre>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/C7hs/0">Run Code</a></p>',frontmatter:{title:"the javaScript Continue Statement",parent:"/home/stuart/guides/src/pages/articles/javascript/the-javascript-continue-statement/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/the-javascript-continue-statement/"}}}});
